(2739, 'options_home_tab_content', 'We hope you find TeachMe PD a useful and easy to use resource to search for and book professional development courses across Australia.\r\nTeachers are required to undertake at least 100 hours of professional development activities in the 5 years leading up to their due date for renewal of registration.\r\n\r\nAt least half the activities must provide access to research and knowledge sourced from outside the immediate school or work environment.\r\n\r\nThe balance of activities can come from either more activities providing access to research and knowledge sourced from outside the immediate school environment or activities teachers identify as contributing to their professional practice, knowledge or well-being. Through our website and social media platforms, we hope to be able to provide you with access to that balance.', 'no'),
(2740, '_options_home_tab_content', 'field_56413ebb0d523', 'no'),
(2741, 'options_my_courses_content', '<aside class="text-primary-dark"></aside><aside class="text-primary-dark">Workshop Etiquette-In order for our courses to maintain a professional atmosphere and efficient order, we ask all attendees to adhere to our simple golden rules.</aside><aside class="text-primary-dark">Please:\r\n<ul>\r\n	<li>As a courtesy to organisers and presenters, always register for a course before attending.</li>\r\n	<li>Arrive on time for registration to avoid being late for the session. If you do arrive late, please find your place quickly and quietly.</li>\r\n	<li>Keep unnecessary noise and conversation, both immediately outside and inside venue rooms, to a minimum.</li>\r\n	<li>Be respectful of both the presenters and your peers and do not talk during the session.</li>\r\n	<li>Ensure your mobile phone is off or on silent. If you need to take a call, please quietly step outside the session.</li>\r\n	<li>Become involved in discussions, but please show courtesy to the presenter of stopping when called upon.</li>\r\n	<li>Always wear appropriate and non-offensive clothing. When offered, wear your name tag so you can be readily identified as an official registrant, and for ease of communication.</li>\r\n</ul>\r\n</aside>', 'no'),
