(313, 15, '2015-10-29 08:19:37', '2015-10-29 08:19:37', 'Big Write and VCOP is designed to bring the fun back into writing, to make the children want to write and to be continuously challenged throughout the writing journey. Through games, activities, writing tasks, conversations and discussions, students will learn not only where their abilities lie in a fun and engaging way, but also the steps they need to take, in order to continue to improve.\r\n\r\n&nbsp;\r\n\r\nBig Write and VCOP is a methodology for raising the standards in writing across all ages and ability levels throughout Australasia. It seeks to address the reasons why there are falling standards in writing. Based on the premise that ‘if they can’t say it, they can’t write it’, we scaffold the learning to allow children to become articulate thinkers and speakers, who will then become articulate writers. It is a differentiated approach suitable for pre-writers, all the way through secondary school. Underpinning the progress the students will achieve is the \'back to basics\' approach of teaching the building blocks of writing through the use of the GHaSP method.\r\n\r\n&nbsp;\r\n\r\nBig Write comes with a comprehensive, evidence-based assessment tool (linked to the Australian National Curriculum), that develops consistency and accuracy of writing assessment right across your school. The Student Friendly Criterion Scale empowers the children by allowing them to analyse where their skill set lies, and specifically what steps they need to take in order to move forward.\r\n<h4 class="text-center" style="font-weight: bold;"><em>Presented BY teachers, FOR teachers.</em></h4>', 'Andrell Education', '', 'publish', 'closed', 'closed', '', 'andrell-education', '', '', '2015-11-16 20:18:22', '2015-11-16 09:18:22', '', 0, 'http://teach-me-pd.dev//provider/andrell-education/', 0, 'tribe_provider', '', 0),
