(330, 1, '2015-09-28 08:29:51', '2015-09-28 08:29:51', 'Professional Development can be defined as \'activities that develop an individual\'s skills, knowledge, expertise and other characteristics as a teacher\' (OECD, 2009, p.49) Therefore, scrolling your Facebook newsfeed, Pinterest, twitter or Instagram should be logged as PD should it not? haha \r\nWell here\'s a few minutes of free PD, you may not be able to log it, but hopefully it sparks a few ideas to stimulate your class.\r\nWhat activities does this picture inspire for you?\r\nFor me, immediately I think I can easily link it in to Social and Well-being, Interpersonal development and Grammar.  \r\n \r\nWe\'ll discuss idioms; looking for them through literacy inquiry, listen out for them in speech and have a go at using them in our writing. We\'ll link in to Big Write and VCOP here (www.facebook.com/andrelleducation) discussing how idioms would come under V-Vocabulary for figurative language.\r\n \r\nSo I\'m thinking we\'ll discuss making judgments about people, or people making judgments about them. We might look at stereotypes and what that means. Depending on the age of my students, we might run a practical social experiment. If I had high school students, we might look at how they might be judged on their age, or dress when they attend a job interview and actually send them off for interviews. What about sending a group into town, split up as a homeless teen group, a wealthy, well dressed female group and maybe a group of skaters. They might have to do something like ask strangers for directions and see the reactions. I might use the topic/idiom \'Walking in someone else\'s shoes\' and ask them to write about their experience. Here i can link in text types either by free choice (Report on experience, recount what happened, Explanation of why you think it happened, Narrative- open ended).  \r\n \r\nIn a Primary school setting, I\'m thinking I\'ll send a note home to parents or have teacher-student \'get to know you\' interviews I\'d ask them for 5 interesting things about themselves/their children that people might not know (hobbies, family, travel, talents, a fear, a celebration etc). \r\nAsk them to send in a photo that captures a special moment and write a short note about what the moment is. \r\nI\'d then frame and wrap all the pictures in brown paper and put the 5 facts on the front. Everyone has to get one (not their own one, if they know). Read out, try and guess, unwrap and read their special moment story.      \r\nYou could bring in speaking and listening and ask for a speech. Maybe this is part of their graduation reflecting on their school experience, maybe a Mother\'s Day/Father\'s Day present.\r\n \r\nThe possibilities are endless... all from seeing a picture on my Facebook feed. So, what do you see? What comes to your creative mind?\r\nComment and Share, after all the best PD\'s are viral!\r\n #bigwrite_vcop #teachme_pd #professionaldevelopment\r\n', 'Professional Development', 'Professional Development can be defined as \'activities that develop an individual\'s skills, knowledge, expertise and other characteristics as a teacher\' (OECD, 2009, p.49)', 'publish', 'open', 'open', '', 'professional-development', '', '', '2015-11-05 06:28:13', '2015-11-05 06:28:13', '', 0, 'http://teach-me-pd.dev//?p=330', 0, 'post', '', 0),
