(340, 15, '2015-10-30 03:24:08', '2015-10-30 03:24:08', 'Like the students in our classrooms, we want you to be engaged, excited and leave with a love of writing. What better way to ensure that, than to take you on a voyage into our Big Write &amp; VCOP antics and adventures. Full of laughs, a few tears (from us), and lots of fun, we’ll do everything we can to ensure that it’s one of the best PD’s you have ever been too.\r\n\r\nYou will leave the day excited, enthused and wanting to race back to your classrooms to play Kung Fu Punctuation, and many other exciting games, with your students.\r\n\r\nIn this session, we will provide you with all the skills and knowledge that you require to get your classroom and students ready for an engaging writing journey. Presented to you by classroom teachers - who have used the program successfully across multiple year levels - you will become their students for the day, to really understand what a Big Write &amp; VCOP classroom looks and feels like.\r\n\r\nWe will cover all stages of the program from setting up your classroom, to integration into the literacy block, running the writing session, editing, up-levelling and analysis, goal setting, and touching on assessment and data tracking.\r\n\r\nThe session runs from 9:00am to 3:30pm. You will be provided with morning tea, lunch, and delegate pack including PowerPoint notes, Australian Criterion Scale and Student Friendly Criterion Scale. However, we ask that you bring a pen and extra note taking materials, as well as your enthusiasm.', 'Albury, Day 1 - Introduction to Big Write &amp; VCOP', 'Like the students in our classrooms, we want you to be engaged, excited and leave with a love of writing. What better way to ensure that, than to take you on a voyage into our Big Write &amp; VCOP antics and adventures. Full of laughs, a few tears (from us), and lots of fun, we’ll do everything we can to ensure that it’s one of the best PD’s you have ever been too.', 'publish', 'open', 'closed', '', 'albury-day-1-introduction-to-big-write-vcop', '', '', '2015-11-07 05:17:49', '2015-11-07 05:17:49', '', 0, 'http://teach-me-pd.dev//', 0, 'tribe_events', '', 0),
