(413, 1, '2015-10-30 03:24:08', '2015-10-30 03:24:08', 'As schools move into a Bring Your Own Device (BYOD) environment, it is important to know what is available for students to use no matter the device they bring. Come along to discover some great BYOD apps, online spaces and strategies to maximise learning opportunities.\r\n\r\n<span style="color: #ffcc00;"><em>Suitability:</em></span>\r\n\r\nThis workshop is suitable for Primary &amp; Secondary school educators, Special school staff, additional needs educators and educational support staff in Government, Catholic, and Independent schools. Pre-service teachers and CRTs will also benefit from attending.\r\n\r\n<span style="color: #ffcc00;"><em>Workshop Overview:</em></span>\r\n\r\nTeachers will engage in practical experiences using recommended apps and online spaces during an engaging and inspirational afternoon session. They will:\r\n<ul>\r\n	<li>Understand common and effective apps they can use at different stages of learning to enhance their BYOD toolkit</li>\r\n	<li>Engage in practical learning experiences they can instantly apply in their classroom</li>\r\n	<li>Overcome issues they may be experiencing implementing a BYOD environment</li>\r\n</ul>\r\n<span style="color: #ffcc00;"><strong>Where: </strong></span>\r\n\r\nDarebin Arts &amp; Entertainment Centre\r\n\r\nCnr Bell St &amp; St Georges Rd, Preston\r\n\r\n<strong><span style="color: #ffcc00;">What to bring:</span>  </strong>\r\n\r\nParticipants need to bring their own mobile device (that can wirelessly access internet, internet connectivity provided) and your enthusiasm.\r\n\r\n<span style="color: #ffcc00;"><strong>What’s provided:</strong>  </span>\r\n\r\nParticipants will receive refreshments upon arrival.  All other materials, tools and resources will be provided on the day.\r\n\r\n<strong><span style="color: #ffcc00;">Time: </span>                           </strong>\r\n\r\n4:00pm Start, 6.00pm Finish', 'BYOD App Toolkit (Afternoon workshop) - Preston', 'Teachers will engage in practical experiences using recommended apps and online spaces during an engaging and inspirational afternoon session.', 'trash', 'open', 'closed', '', 'byod-app-toolkit-2', '', '', '2015-11-07 04:48:57', '2015-11-07 04:48:57', '', 0, 'http://teach-me-pd.dev//', 0, 'tribe_events', '', 0),
