(422, 1, '2015-10-30 18:23:48', '2015-10-30 18:23:48', '', 'Engaging Reluctant Literacy Learners (Full day workshop)', 'This full day eLearning Literacy workshop for classroom teachers, address the key issues in student disengagement that prevent students from reaching their full potential. Teachers will participate in innovative and practical hands-on literacy activities (especially using ICT) that motivate reluctant learners, improve student outcomes and can be immediately applied in the Early Years and Middle Years classrooms.', 'publish', 'open', 'closed', '', 'engaging-reluctant-literacy-learners-full-day-workshop', '', '', '2015-11-18 19:42:17', '2015-11-18 08:42:17', '', 0, 'http://teach-me-pd.dev//product/engaging-reluctant-literacy-learners-full-day-workshop/', 0, 'product', '', 0),
