(424, 1, '2015-10-30 18:25:57', '2015-10-30 18:25:57', '', 'BYOD App Toolkit (Afternoon workshop)', 'Teachers will engage in practical experiences using recommended apps and online spaces during an engaging and inspirational afternoon session.', 'publish', 'open', 'closed', '', 'byod-app-toolkit-afternoon-workshop', '', '', '2015-11-18 19:42:17', '2015-11-18 08:42:17', '', 0, 'http://teach-me-pd.dev//product/byod-app-toolkit-afternoon-workshop/', 0, 'product', '', 0),
(425, 1, '2015-10-30 19:16:13', '2015-10-30 19:16:13', 'We believe these are the key things students need to be successful readers and writers (who spell correctly!).\r\nYou can learn about the value and importance of these approaches, as well as fun ways to integrate them into your current spelling lessons. To help you in engaging students, we will provide you with games, hands on resources and handy tips that will encourage children in improving their spelling skills. In these sessions, you have a host of resources and ideas you can use to fit into your current classroom schedule.\r\nYou don’t need to commit to buying our program. This PD gives you an insight into the teaching style and content that has been having great results for over 20 years! Let Danielle, a teacher herself, get you excited about teaching spelling!', 'DIPL- Doorway into Practical Literacy', '', 'publish', 'closed', 'closed', '', 'dipl-doorway-into-practical-literacy', '', '', '2015-11-16 13:23:40', '2015-11-16 02:23:40', '', 0, 'http://teach-me-pd.dev//', 0, 'tribe_provider', '', 0),
