(432, 1, '2015-10-30 19:45:31', '2015-10-30 19:45:31', '<h2>Developmental curriculum from Foundation to Year 6</h2>\r\nIdeas are built on and expanded as students move from level to level,  ensuring that no content is repeated.\r\n\r\nMAPPEN is written to match maturity and readiness of students at each level.\r\n\r\nWith MAPPEN all students are investigating the same concept at the same time.\r\n\r\n&nbsp;\r\n\r\nhttps://www.youtube.com/channel/UCidqvUzKghvOSOhhhwdICTA', 'Mappen', '', 'publish', 'closed', 'closed', '', 'mappen', '', '', '2015-11-14 21:01:53', '2015-11-14 10:01:53', '', 0, 'http://teach-me-pd.dev//', 0, 'tribe_provider', '', 0),
