(500, 1, '2015-10-30 03:24:08', '2015-10-30 03:24:08', '<strong>There are growing requests from teachers for support on how to effectively engage students who are reluctant to learn at school especially in the vital area of Literacy. There is also a need to update teachers’ professional knowledge in using ICT as a powerful tool that can make a greater difference in learning. We are pleased to provide a workshop using ICT to improve student engagement for reluctant learners within the Early and Middle Years focusing on Literacy.</strong>\r\n\r\n<span style="text-decoration: underline"><span style="color: #ffcc00;text-decoration: underline">Suitability<em>:</em></span></span>\r\n\r\nThis workshop is suitable for Educators (Primary, Secondary &amp; Special Needs), Support staff and pre-service teachers.\r\n\r\n<span style="color: #ffcc00"><em><u>Workshop Overview: </u></em></span>\r\n\r\nThis full day eLearning Literacy workshop for classroom teachers, address the key issues in student disengagement that prevent students from reaching their full potential. Teachers will participate in innovative and practical hands-on literacy activities (especially using ICT) that motivate reluctant learners, improve student outcomes and can be immediately applied in the Early Years and Middle Years classrooms.\r\n\r\n<span style="color: #ffcc00"><em>This full day workshop will allow classroom teachers to successfully:</em></span>\r\n<ul>\r\n	<li>Identify key issues that disengage students in Literacy;</li>\r\n	<li>Understand how to engage students using effective eLearning strategies &amp; tools;</li>\r\n	<li>Experience the most relevant and motivating use of ICT to achieve student outcomes in Literacy at different learning stages;</li>\r\n	<li>Apply all e5 Principles using ICT to ensure learning progress;</li>\r\n	<li>Provide incidental authentic assessment opportunities that guide achievable learning outcomes;</li>\r\n	<li>Be empowered to make a positive difference</li>\r\n</ul>\r\n<strong> </strong>\r\n<p style="text-align: left"><strong><span style="color: #ffcc00">Where:</span></strong></p>\r\nEdumazing Educational Studios\r\n\r\nLevel 1/84 Synnot St, Werribee\r\n<p style="text-align: left"><strong><span style="color: #ffcc00">What to bring:</span> </strong></p>\r\n<p style="text-align: left">Participants need to bring a pen, a digital device or laptop and their enthusiasm.</p>\r\n<p style="text-align: left"><span style="color: #ffcc00"><strong>What’s provided:</strong></span></p>\r\n<p style="text-align: left">Participants will receive pre-workshop refreshments upon arrival, morning tea and a deliciously catered lunch.</p>\r\n<p style="text-align: left">All other materials, tools and resources will be provided on the day.</p>\r\n<p style="text-align: left"><span style="color: #ffcc00"><strong>Time:</strong></span></p>\r\n<p style="text-align: left">8.45am Registration, 9am Start, 3.30pm Finish</p>\r\n<p style="text-align: center"><span style="color: #ffcc00"><u>Here is some feedback we have had from teachers about this Workshop:</u></span></p>\r\n<p style="text-align: center"><em>"A fun and engaging way to hook teachers into becoming extraordinary teachers - not ordinary teachers!" </em></p>\r\n<p style="text-align: center"><em>"This workshop stops you from thinking that reluctant learners are lazy, or can\'t do things, but shows you that these learners  are just not ready to learn, and demonstrates various ways to help engage them and get them ready in life." </em></p>\r\n<p style="text-align: center"><em>"This is a highly professional, relevant, informative and \'hands on\' P.D. The best P.D I have been to!"</em></p>', 'Engaging Reluctant Literacy Learners- Werribee', 'This full day eLearning Literacy workshop for classroom teachers, address the key issues in student disengagement that prevent students from reaching their full potential. Teachers will participate in innovative and practical hands-on literacy activities (especially using ICT) that motivate reluctant learners, improve student outcomes and can be immediately applied in the Early Years and Middle Years classrooms.', 'trash', 'open', 'closed', '', 'engaging-reluctant-literacy-learners-2-2', '', '', '2015-11-07 04:48:57', '2015-11-07 04:48:57', '', 0, 'http://teach-me-pd.dev//', 0, 'tribe_events', '', 0),
(501, 18, '2015-11-07 03:55:05', '2015-11-07 03:55:05', 'As schools move into a Bring Your Own Device (BYOD) environment, it is important to know what is available for students to use no matter the device they bring. Come along to discover some great BYOD apps, online spaces and strategies to maximise learning opportunities.\r\n\r\nSuitability:\r\n\r\nThis workshop is suitable for Primary &amp; Secondary school educators, Special school staff, additional needs educators and educational support staff in Government, Catholic, and Independent schools. Pre-service teachers and CRTs will also benefit from attending.\r\n\r\n<em>Workshop Overview:</em>\r\n\r\nTeachers will engage in practical experiences using recommended apps and online spaces during an engaging and inspirational afternoon session. They will:\r\n<ul>\r\n	<li>Understand common and effective apps they can use at different stages of learning to enhance their BYOD toolkit</li>\r\n	<li>Engage in practical learning experiences they can instantly apply in their classroom</li>\r\n	<li>Overcome issues they may be experiencing implementing a BYOD environment</li>\r\n</ul>\r\n&nbsp;', 'BYOD App Toolkit (Afternoon workshop)- Werribee', '', 'publish', 'open', 'closed', '', 'byod-app-toolkit-afternoon-workshop-werribee', '', '', '2015-11-07 04:46:27', '2015-11-07 04:46:27', '', 0, 'http://teach-me-pd.dev//', 0, 'tribe_events', '', 0),
