(518, 18, '2015-11-07 03:55:05', '2015-11-07 03:55:05', '<strong>There are growing requests from teachers for support on how to effectively engage students who are reluctant to learn at school especially in the vital area of Literacy. There is also a need to update teachers’ professional knowledge in using ICT as a powerful tool that can make a greater difference in learning. We are pleased to provide a workshop using ICT to improve student engagement for reluctant learners within the Early and Middle Years focusing on Literacy.</strong>\r\n\r\nSuitability<em>:</em>\r\n\r\nThis workshop is suitable for Educators (Primary, Secondary &amp; Special Needs), Support staff and pre-service teachers.\r\n\r\n<em><u>Workshop Overview:</u></em>\r\n\r\nThis full day eLearning Literacy workshop for classroom teachers, address the key issues in student disengagement that prevent students from reaching their full potential. Teachers will participate in innovative and practical hands-on literacy activities (especially using ICT) that motivate reluctant learners, improve student outcomes and can be immediately applied in the Early Years and Middle Years classrooms.\r\n\r\n<em>This full day workshop will allow classroom teachers to successfully:</em>\r\n<ul>\r\n	<li>Identify key issues that disengage students in Literacy;</li>\r\n	<li>Understand how to engage students using effective eLearning strategies &amp; tools;</li>\r\n	<li>Experience the most relevant and motivating use of ICT to achieve student outcomes in Literacy at different learning stages;</li>\r\n	<li>Apply all e5 Principles using ICT to ensure learning progress;</li>\r\n	<li>Provide incidental authentic assessment opportunities that guide achievable learning outcomes;</li>\r\n	<li>Be empowered to make a positive difference</li>\r\n</ul>\r\n<p style="text-align: center;"><u>Here is some feedback we have had from teachers about this Workshop:</u></p>\r\n<p style="text-align: center;"><em>“A fun and engaging way to hook teachers into becoming extraordinary teachers – not ordinary teachers!”</em></p>\r\n<p style="text-align: center;"><em>“This workshop stops you from thinking that reluctant learners are lazy, or can’t do things, but shows you that these learners  are just not ready to learn, and demonstrates various ways to help engage them and get them ready in life.”</em></p>\r\n<p style="text-align: center;"><em>“This is a highly professional, relevant, informative and ‘hands on’ P.D. The best P.D I have been to!”</em></p>', 'Engaging Reluctant Literacy Learners- Werribee', '', 'publish', 'open', 'closed', '', 'engaging-reluctant-literacy-learners-werribee-2', '', '', '2015-11-15 13:26:15', '2015-11-15 02:26:15', '', 0, 'http://teach-me-pd.dev//', 0, 'tribe_events', '', 0),
(519, 18, '2015-11-07 04:33:23', '2015-11-07 04:33:23', '', 'Engaging Reluctant Literacy Learners- Werribee', '', 'publish', 'open', 'closed', '', 'engaging-reluctant-literacy-learners-werribee', '', '', '2015-11-07 04:33:23', '2015-11-07 04:33:23', '', 0, 'http://teach-me-pd.dev//product/engaging-reluctant-literacy-learners-werribee/', 0, 'product', '', 0),
(520, 18, '2015-11-07 03:55:05', '2015-11-07 03:55:05', '<strong>Blogging is transforming the way we learn, collaborate and reflect. It offers authentic assessment opportunities, improves literacy skills and can be used by educators for many purposes including classroom digital portfolios, professional portfolios and as a professional learning tool.  Find out just how easy it is to setup your own blog for yourself and for your students.</strong>\r\n\r\n<em><u>Suitability:</u></em>\r\n\r\nThis workshop is suitable for Educators (Primary, Secondary &amp; Special Needs), Support staff and pre-service teachers.\r\n\r\n<em><u>Workshop Overview:</u></em>\r\n\r\nTeachers will experience practical hands on activities, professional conversations, blogging tools and additional support resources throughout the entire day.\r\n\r\n<em>This hands-on eLearning workshop will allow classroom teachers to successfully:</em>\r\n<ul>\r\n	<li>Understand what Blogs are, including different types and uses;</li>\r\n	<li>Create a simple Word Press Blog via edublogs (private school teachers) or Global 2 (public school teachers);</li>\r\n	<li>Explore how blogs improve student literacy skills and engagement;</li>\r\n	<li>Experience how blogs can be used as powerful authentic assessment tools;</li>\r\n	<li>Access strategies and activities to use blogs effectively in the classroom based on student needs and stages of learning;</li>\r\n	<li>Access outstanding blogs that can be used with students in the classroom to support different areas of the curriculum (for Primary &amp; Secondary students);</li>\r\n	<li>Identify important protocols and practices in the effective use of blogs including privacy and communication with parents/guardians;</li>\r\n</ul>\r\n<p style="text-align: center;"><u>Here is some feedback we have had from teachers about this Workshop:</u></p>\r\n<p style="text-align: center;"><em>“EDU-mazing!! Perfect course for 21st century learners.” – Felicity.</em></p>\r\n<p style="text-align: center;"><em>“Totally worth it! I have left with 2 blogs created &amp; a heap of resources to go &amp; explore &amp; play with.” – Jessica.</em></p>\r\n<p style="text-align: center;"><em>“A great day, a lot of interesting, exciting and engaging information was given. It really gave me a new enthusiasm for blogging within my classroom. A great tool to get the kids excited.” – Kate.</em></p>', 'The Power of Blogging- Burwood', '', 'publish', 'open', 'closed', '', 'the-power-of-blogging-burwood', '', '', '2015-11-16 11:42:00', '2015-11-16 00:42:00', '', 0, 'http://teach-me-pd.dev//', 0, 'tribe_events', '', 0),
