(523, 15, '2015-11-07 05:07:20', '2015-11-07 05:07:20', 'Like the students in our classrooms, we want you to be engaged, excited and leave with a love of writing. What better way to ensure that, than to take you on a voyage into our Big Write &amp; VCOP antics and adventures. Full of laughs, a few tears (from us), and lots of fun, we’ll do everything we can to ensure that it’s one of the best PD’s you have ever been too.\n\nYou will leave the day excited, enthused and wanting to race back to your classrooms to play Kung Fu Punctuation, and many other exciting games, with your students.\n\nIn this session, we will provide you with all the skills and knowledge that you require to get your classroom and students ready for an engaging writing journey. Presented to you by classroom teachers - who have used the program successfully across multiple year levels - you will become their students for the day, to really understand what a Big Write &amp; VCOP classroom looks and feels like.\n\nWe will cover all stages of the program from setting up your classroom, to integration into the literacy block, running the writing session, editing, up-levelling and analysis, goal setting, and touching on assessment and data tracking.\n\nThis is exactly the same Day 1 course, but', 'Frankston, Day 1 - Introduction to Big Write &amp; VCOP', 'Like the students in our classrooms, we want you to be engaged, excited and leave with a love of writing. What better way to ensure that, than to take you on a voyage into our Big Write &amp; VCOP antics and adventures. Full of laughs, a few tears (from us), and lots of fun, we’ll do everything we can to ensure that it’s one of the best PD’s you have ever been too.', 'inherit', 'closed', 'closed', '', '345-autosave-v1', '', '', '2015-11-07 05:07:20', '2015-11-07 05:07:20', '', 345, 'http://teach-me-pd.dev//2015/11/345-autosave-v1/', 0, 'revision', '', 0),
(524, 15, '2015-11-07 05:09:56', '2015-11-07 05:09:56', 'We understand that there was a lot of information in Day 1, and that we only just touched on assessment so as not to overwhelm you. When you walked away, your focus should have been on setting up your classroom and introducing the program slowly. For that reason, we have started running Day 2, dedicated to Assessment &amp; Data Tracking.\n\nIt is imperative that you have not only completed Day 1, but have set up your classroom and started having a go at assessment with the Australian Criterion Scale, (we recommend at least 4-6 months between sessions).\n\n<strong>Participants are required to bring 2 photocopies of low, mid, and high assessment pieces from their classrooms which they have assessed using the Australian Criterion Scale, using the moderating template (available on the website in the ‘Downloads’ section).</strong>\n\nDay 2 will cover the more intensive Assessment &amp; Data Tracking element of the program for both your classroom and at a school wide tracking level.\n\nIn this session, we will reflect on your progress so far, share with you in your celebrations, and seek to help overcome any hurdles you have come across that are preventing you from reaching your goals. From there we are going to model and practise placing children on an appropriate level and discuss why it is important to look at all aspects of the writing piece, and not to pre-judge based on length, handwriting, etc.\n\nThe next step is gaining a deeper understanding of the criteria at various levels, so we will be modelling, sharing, and practising on the pieces you have brought in to make it more relevant to your classroom. From this, we will look at goal setting appropriate to moving that child forward.\n\nWe will then look at data tracking in your classroom, across your year level, and school wide, showing you different ways of collecting, using, and recording data to ensure it is purposeful.\n\nOf course, during the day we will still suggest and play games and activities that you can take back to your classroom to add to your resource kits. As usual with the Andrell team, you will be guaranteed chocolates and a laugh.', 'Sale, Day 2 - Assessment and Data Tracking', 'We understand that there was a lot of information in Day 1, and that we only just touched on assessment so as not to overwhelm you. When you walked away, your focus should have been on setting up your classroom and introducing the program slowly. For that reason, we have started running Day 2, dedicated to Assessment &amp; Data Tracking.\n\nIt is imperative that you have not only completed Day 1, but have set up your classroom and started having a go at assessment with the Australian Criterion Scale, (we recommend at least 4-6 months between sessions).', 'inherit', 'closed', 'closed', '', '367-autosave-v1', '', '', '2015-11-07 05:09:56', '2015-11-07 05:09:56', '', 367, 'http://teach-me-pd.dev//2015/11/367-autosave-v1/', 0, 'revision', '', 0),
