(535, 1, '2015-11-07 05:46:47', '2015-11-07 05:46:47', '[woocommerce_my_account]\r\n\r\n<span style="color: #003366;"><b><i>Workshop Etiquette-</i></b></span>\r\n\r\n<span style="color: #003366;"><b><i>In order for our courses to maintain a professional atmosphere and efficient order, we ask all attendees to adhere to our simple golden rules.</i></b></span>\r\n\r\n<span style="color: #003366;"><i>Please;</i></span>\r\n<ul>\r\n	<li><span style="color: #003366;"><i> As a courtesy to organisers and presenters, always register for a course before attending.</i></span></li>\r\n</ul>\r\n<ul>\r\n	<li><span style="color: #003366;"><i>Arrive on time for registration to avoid being late for the session. If you do arrive late, please find your place quickly and quietly.</i></span></li>\r\n</ul>\r\n<ul>\r\n	<li><span style="color: #003366;"><i>Keep unnecessary noise and conversation, both immediately outside and inside venue rooms, to a minimum.</i></span></li>\r\n	<li><span style="color: #003366;"><i> Be respectful of both the presenters and your peers and do not talk during the session.</i></span></li>\r\n</ul>\r\n<ul>\r\n	<li><span style="color: #003366;"><i>Ensure your mobile phone is off or on silent. If you need to take a call, please quietly step outside the session.</i></span></li>\r\n</ul>\r\n<ul>\r\n	<li><span style="color: #003366;"><i>Become involved in discussions, but please show courtesy to the presenter of stopping when called upon.</i></span></li>\r\n</ul>\r\n<ul>\r\n	<li><span style="color: #003366;"><i>Always wear appropriate and non-offensive clothing. When offered, wear your name tag so you can be readily identified as an official registrant, and for ease of communication.</i></span></li>\r\n</ul>', 'My Account', '', 'inherit', 'closed', 'closed', '', '6-revision-v1', '', '', '2015-11-07 05:46:47', '2015-11-07 05:46:47', '', 6, 'http://teach-me-pd.dev//2015/11/6-revision-v1/', 0, 'revision', '', 0),
(536, 1, '2015-11-07 05:47:35', '2015-11-07 05:47:35', '[woocommerce_my_account]\r\n<h4><span style="color: #003366;"><b><i>Workshop Etiquette-</i></b></span></h4>\r\n<span style="color: #003366;"><b><i>In order for our courses to maintain a professional atmosphere and efficient order, we ask all attendees to adhere to our simple golden rules.</i></b></span>\r\n\r\n<span style="color: #003366;"><i>Please;</i></span>\r\n<ul>\r\n	<li><span style="color: #003366;"><i> As a courtesy to organisers and presenters, always register for a course before attending.</i></span></li>\r\n</ul>\r\n<ul>\r\n	<li><span style="color: #003366;"><i>Arrive on time for registration to avoid being late for the session. If you do arrive late, please find your place quickly and quietly.</i></span></li>\r\n</ul>\r\n<ul>\r\n	<li><span style="color: #003366;"><i>Keep unnecessary noise and conversation, both immediately outside and inside venue rooms, to a minimum.</i></span></li>\r\n	<li><span style="color: #003366;"><i> Be respectful of both the presenters and your peers and do not talk during the session.</i></span></li>\r\n</ul>\r\n<ul>\r\n	<li><span style="color: #003366;"><i>Ensure your mobile phone is off or on silent. If you need to take a call, please quietly step outside the session.</i></span></li>\r\n</ul>\r\n<ul>\r\n	<li><span style="color: #003366;"><i>Become involved in discussions, but please show courtesy to the presenter of stopping when called upon.</i></span></li>\r\n</ul>\r\n<ul>\r\n	<li><span style="color: #003366;"><i>Always wear appropriate and non-offensive clothing. When offered, wear your name tag so you can be readily identified as an official registrant, and for ease of communication.</i></span></li>\r\n</ul>', 'My Account', '', 'inherit', 'closed', 'closed', '', '6-revision-v1', '', '', '2015-11-07 05:47:35', '2015-11-07 05:47:35', '', 6, 'http://teach-me-pd.dev//2015/11/6-revision-v1/', 0, 'revision', '', 0),
