(552, 1, '2015-11-18 17:01:14', '2015-11-18 06:01:14', 'Kinect2Dance is a Melbourne based dance company dedicated to connecting students with dance!\nFostering the needs of kinesthetic learners can often be challenging, especially for education professionals with little experience in dance. Due to this, and the importance of dance within the Australian National Curriculum, Kinect2Dance offers half term and full term dance courses specifically for primary and secondary schools.\n\nOur teachers have had over 8 years experience in a vast range of styles of dance, from years Foundation to University students.\nOur dance programs are structured around the requirements of the Australian National Curriculum, and run one day per week for either for half the term or a whole term. Our classes run for 40-60mins on site, and embody socialisation and transcendence.\nEach program is individualised for your schools needs; working towards outcomes such as school discos,\nPhysical education and Performing arts, school concerts, barn dance, graduation and much more.\nOur highly experienced instructors teach a variety of modern and traditional dances, which encourage and\nsupport resilience, co-operation, mindfulness and confidence in these fun and energetic dance lessons.', 'Kinect2Dance', '', 'inherit', 'closed', 'closed', '', '444-autosave-v1', '', '', '2015-11-18 17:01:14', '2015-11-18 06:01:14', '', 444, 'http://teach-me-pd.dev//2015/11/444-autosave-v1/', 0, 'revision', '', 0),
