(555, 1, '2015-11-11 05:12:15', '2015-11-11 05:12:15', 'We are a connected and growing community of caring professionals, educators, young people and families. We take massive action to transform our learning, our wellbeing and our lives through the power of Human Literacy<sup>TM</sup>. To us, learning, inspiring and leading with heart matters.\r\n\r\nWe have four sectors of educational and wellbeing service provision:\r\n<ol>\r\n	<li>Educators &amp; Schools</li>\r\n	<li>Young People &amp; Families</li>\r\n	<li>Graduate Teachers, Preservice Teachers and CRTs (Edgrad Academy)</li>\r\n	<li>Business and Communities</li>\r\n</ol>\r\nOur work and leadership in all sectors of education, provides us with a wealth of expertise that drives our quality endorsed professional development services to schools and educators. We are strongly grounded in progressive pedagogies, curriculum development, holistic assessment, working with diverse learners, behaviour transformation, student engagement &amp; wellbeing, digital technologies &amp; digital learning, community cybersafety programs and whole school cultural change.\r\n\r\nAlthough we continually break new ground in providing innovative approaches to learning and wellbeing, where we think without a box, all of our work is supported by extensive research. Our experienced presenters continue to work with young people aged 3 to adult in different school and community settings which ensures we understand the current educational environment that informs our workshops and presentations.\r\n\r\nWe are educational. We are amazing. We are edumazing®. Join us to redesign the present and shape a future yet unimagined.', 'Edumazing', '', 'inherit', 'closed', 'closed', '', '402-autosave-v1', '', '', '2015-11-11 05:12:15', '2015-11-11 05:12:15', '', 402, 'http://teach-me-pd.dev//2015/11/402-autosave-v1/', 0, 'revision', '', 0),
