(574, 18, '2015-11-07 03:55:05', '2015-11-07 03:55:05', '<p style="text-align: center;"><em><strong>Are you a Graduate, Preservice Teacher, CRT, or Returning teacher planning to transition into a primary classroom?</strong></em></p>\r\n<p style="text-align: center;"><em><strong>Do you wish you knew easy and innovative ways to enhance your teaching and student learning?</strong></em></p>\r\n<p style="text-align: center;"><em><strong> If you answered yes, than this Innovation Meet is for you.</strong></em></p>\r\n<p style="text-align: center;">Get <strong>READY </strong>for a full day of professional learning experiences that will <strong>SET </strong>you up for teaching success and support you to <strong>LEARN </strong>how to have an edumazing year within a <strong>primary school</strong><span class="apple-converted-space">.</span></p>\r\n<strong>Suitability:</strong>\r\n\r\nThis Innovation Meet is for educators in the primary school sector, in particular: Graduates, Preservice Teachers, CRTs, and Returning teachers transitioning into a primary school classroom.\r\n\r\n<strong>The <em>Behaviour</em>torium</strong>\r\n\r\nDiscover practical strategies to support you to work more effectively with challenging behaviours. Understand the language of behaviour, and how it links to children’s thoughts, feelings and needs. Experience a holistic behaviour framework that increases understanding of the child and simple steps you can take to minimise harm and maximise learning. Uncover simple ways you can foster connection and learning to increase positive behaviours in the classroom and engage all students to thrive.\r\n\r\n&nbsp;\r\n\r\n<strong>The <em>Empowerment</em> Zone</strong>\r\n\r\nStep up and empower yourself as a teacher moving from the ordinary to the extraordinary.  Develop a powerful teacher blueprint as an activator of learning, and set achievable expectations.  Learn how a growth mindset will allow you and your students to create a learning culture that fosters student personalised and self-directed learning where all students achieve ongoing success. This includes using practical assessment strategies, planning techniques and digital tools to drive powerful progressive learning and pedagogy. Extend your communication skills and improve relationships with your students, colleagues and parents.  Learn how to nurture habits that will keep you organised, focused and passionate about each working day.\r\n\r\n&nbsp;\r\n\r\n<strong>The <em>Maker</em>Pit</strong>\r\n\r\n<span class="apple-converted-space">Experience a combined</span> innovative maker-space and hands-on learning sandpit to improve learning from the onset. Join us and be inspired to explore, make and discover learning experiences that will engage and stimulate your students socially, physically, intellectually, culturally and emotionally. Grow your classroom and young minds with limitless engaging possibilities that shape deeper learning across the curriculum.\r\n\r\n&nbsp;\r\n\r\n<strong>Three more ways to supercharge your learning:</strong>\r\n\r\nThe <em><strong>Connect</strong></em><strong>ion Hub </strong>is a private collaborative online space where you will all be excited to share ideas, explore challenges, solve problems and support one another to continually grow and improve your teaching from this point forward. It is your very own Professional Learning Network that brings together professionals with common interests and needs.\r\n\r\nThe <em><strong>Playground </strong></em>is our common meeting place during recess and lunchtime. Enjoy the playground puzzlers that will engage and disrupt you, while you dine, talk and laugh with other educational innovators.  It’s the perfect place to reimagine learning and to share great ideas.\r\n\r\nAfterwards, let’s meet up at the <em><strong>Happiness Hangout </strong></em>for mindset-making, dream-catching, challenge-busting and celebrating your new professional journey to come.\r\n\r\n<strong>Innovation Meet Registration and Cost:</strong>\r\n\r\nRegistration for Ready…Set…Learn is made online, and allows for individual and group bookings.  Be sure to take advantage of our special prices:\r\n\r\nIf you register now (by Sunday 15<sup>th </sup>of November 2015), you will receive the promotion price of $175 inc GST.\r\n\r\nIf you register by Sunday 27<sup>th</sup>of December 2015, you will receive the early bird price of $199 inc GST.\r\n\r\nIf you register from Monday 28<sup>th</sup>December 2015, you will receive our last minute price of $220 inc GST\r\n\r\n<strong>*N.B. There are no withdrawals or cancellations for this event.</strong>\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Innovation Meet: Ready...Set...Learn! - Preston', '', 'publish', 'open', 'closed', '', 'innovation-meet-ready-set-learn-preston', '', '', '2015-11-16 13:48:46', '2015-11-16 02:48:46', '', 0, 'http://teach-me-pd.dev//', 0, 'tribe_events', '', 0),
