(579, 1, '2015-11-16 10:36:34', '2015-11-15 23:36:34', 'Like the students in our classrooms, we want you to be engaged, excited and leave with a love of writing. What better way to ensure that, than to take you on a voyage into our Big Write &amp; VCOP antics and adventures. Full of laughs, a few tears (from us), and lots of fun, we’ll do everything we can to ensure that it’s one of the best PD’s you have ever been too.\r\n\r\nYou will leave the day excited, enthused and wanting to race back to your classrooms to play Kung Fu Punctuation, and many other exciting games, with your students.\r\n\r\nIn this session, we will provide you with all the skills and knowledge that you require to get your classroom and students ready for an engaging writing journey. Presented to you by classroom teachers - who have used the program successfully across multiple year levels - you will become their students for the day, to really understand what a Big Write &amp; VCOP classroom looks and feels like.\r\n\r\nWe will cover all stages of the program from setting up your classroom, to integration into the literacy block, running the writing session, editing, up-levelling and analysis, goal setting, and touching on assessment and data tracking.\r\n\r\nThis is exactly the same Day 1 course, but we have a presenter in training. As such, we are offering a reduced rate.\r\n\r\n$200 for school invoiced teachers, $150 for CRT\'s and $100 for Student teachers.', 'Frankston, Day 1 - Introduction to Big Write &amp; VCOP', 'Like the students in our classrooms, we want you to be engaged, excited and leave with a love of writing. What better way to ensure that, than to take you on a voyage into our Big Write &amp; VCOP antics and adventures. Full of laughs, a few tears (from us), and lots of fun, we’ll do everything we can to ensure that it’s one of the best PD’s you have ever been too.', 'inherit', 'closed', 'closed', '', '345-autosave-v1', '', '', '2015-11-16 10:36:34', '2015-11-15 23:36:34', '', 345, 'http://teach-me-pd.dev//2015/11/345-autosave-v1/', 0, 'revision', '', 0),
