(583, 1, '2015-11-16 11:33:50', '2015-11-16 00:33:50', 'We understand that there was a lot of information in Day 1, and that we only just touched on assessment so as not to overwhelm you. When you walked away, your focus should have been on setting up your classroom and introducing the program slowly. For that reason, we have started running Day 2, dedicated to Assessment &amp; Data Tracking.\r\n\r\nIt is imperative that you have not only completed Day 1, but have set up your classroom and started having a go at assessment with the Australian Criterion Scale, (we recommend at least 4-6 months between sessions).\r\n\r\n<strong>Participants are required to bring 2 photocopies of low, mid, and high assessment pieces from their classrooms which they have assessed using the Australian Criterion Scale, using the moderating template (available on the website in the ‘Downloads’ section).</strong>\r\n\r\nDay 2 will cover the more intensive Assessment &amp; Data Tracking element of the program for both your classroom and at a school wide tracking level.\r\n\r\nIn this session, we will reflect on your progress so far, share with you in your celebrations, and seek to help overcome any hurdles you have come across that are preventing you from reaching your goals. From there we are going to model and practise placing children on an appropriate level and discuss why it is important to look at all aspects of the writing piece, and not to pre-judge based on length, handwriting, etc.\r\n\r\nThe next step is gaining a deeper understanding of the criteria at various levels, so we will be modelling, sharing, and practising on the pieces you have brought in to make it more relevant to your classroom. From this, we will look at goal setting appropriate to moving that child forward.\r\n\r\nWe will then look at data tracking in your classroom, across your year level, and school wide, showing you different ways of collecting, using, and recording data to ensure it is purposeful.\r\n\r\nOf course, during the day we will still suggest and play games and activities that you can take back to your classroom to add to your resource kits. As usual with the Andrell team, you will be guaranteed chocolates and a laugh.', 'Sale, Day 2 - Assessment and Data Tracking', 'We understand that there was a lot of information in Day 1, and that we only just touched on assessment so as not to overwhelm you. When you walked away, your focus should have been on setting up your classroom and introducing the program slowly. For that reason, we have started running Day 2, dedicated to Assessment &amp; Data Tracking.\r\n\r\nIt is imperative that you have not only completed Day 1, but have set up your classroom and started having a go at assessment with the Australian Criterion Scale, (we recommend at least 4-6 months between sessions).', 'inherit', 'closed', 'closed', '', '367-autosave-v1', '', '', '2015-11-16 11:33:50', '2015-11-16 00:33:50', '', 367, 'http://teach-me-pd.dev//2015/11/367-autosave-v1/', 0, 'revision', '', 0),
