(586, 1, '2015-11-16 13:17:21', '2015-11-16 02:17:21', 'We believe these are the key things students need to be successful readers and writers (who spell correctly!).\nYou can learn about the value and importance of these approaches, as well as fun ways to integrate them into your\ncurrent spelling lessons. To help you in engaging students, we will provide you with games, hands on resources and\nhandy tips that will encourage children in improving their spelling skills. In these sessions, you have a host of\nresources and ideas you can use to fit into your current classroom schedule.\nYou don’t need to commit to buying our program. This PD gives you an insight into the teaching style and content\nthat has been having great results for over 20 years! Let Danielle, a teacher herself, get you excited about\nteaching spelling!', 'DIPL- Doorway into Practical Literacy', '', 'inherit', 'closed', 'closed', '', '425-autosave-v1', '', '', '2015-11-16 13:17:21', '2015-11-16 02:17:21', '', 425, 'http://teach-me-pd.dev//2015/11/425-autosave-v1/', 0, 'revision', '', 0),
