INSERT INTO `wp_rg_lead_detail_long` ( `lead_detail_id`, `value`) VALUES
(49, 'Children\'s mental health - Social and Emotional Learning. We offer trainings to schools as well as resources specific to running the BEST SEL program approved by Kids Matter Australia. Training is offered all over Australia throughout the year on a range of topics that help teachers to understand and work with every child in their room - not just the children experiencing mental health difficulties.'),
(50, 'We are highly experienced children\'s mental health specialists and authors. We offer packages to school and customised \'trouble-shooting\' trainings too.\r\nWe are based in both Perth and Melbourne but travel widely offering top quality Workshops - both as stand alone events and within schools too.\r\nWe would like to have the opportunity to speak with you further about the training workshops we are offering in 2016. Many thanks, Claire'),
(56, 'Hello,\r\nYesterday when I registered and booked for VCOP in Frankston on Nov 1st I gave my email address as clairescott.comtact@gmail.com instead of clairescott.contact@gmail.com and therefor my confirmation email and invoice have gone to the wrong email address. I have since updated details but wanted to make sure all necessary documents made it to me. Thank you for assistance.\r\n\r\nClaire Scott') ;
